bool	lib3d::GetLocationA	(	Vec3**		outLocationA,
								int*		outLocationCount,
								MeshType	inMesh				)
{
	if( inMesh == MT_Bunny )
	{
		*outLocationA = (Vec3*)bunny_vtxA;
		*outLocationCount = bunny_vtxCount;
		return true;
	}
	return false;
}

bool	lib3d::GetIndexA	(	ushort**	outIndexA,
								int*		outIndexCount,
								MeshType	inMesh				)
{
	if( inMesh == MT_Bunny )
	{
		*outIndexA = bunny_idxA;
		*outIndexCount = bunny_triCount*3;
		return true;
	}
	return false;
}

